import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';
import './navstyle.css';
import $ from 'jquery';

class Nav extends Component {

  componentDidMount = () => {
    $(document).ready(function() {
      $(window).scroll(function() {
        if ($(document).scrollTop() > 400) {
          console.log('hello');
          $(".navbar").addClass("test");
        } else {
           $(".navbar").removeClass("test");
    }
    });
  });
    }

  render(){
   return (
      <div className='nav'>
      <h3>Anjali</h3>
       <Link
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Home</span></Link>
       <Link
          style={{marginLeft:10}}
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      ><span className='heading'>About</span></Link>
        <Link
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Resume</span></Link>
        <Link
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Portfolio</span></Link>
        <Link
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Contact</span></Link>
  </div>
    );
  }
}

export default Nav;
